(window.webpackJsonprecipes=window.webpackJsonprecipes||[]).push([[54],{2210:e=>{e.exports="# Cake chèvre-noix\n\n_Préchauffer le four à 180°._\n\n## Ingrédients\n\n- Farine | 150 g |\n- Oeufs | 3 |\n- Huile d'olive | 5 cl |\n- Lait | 12 cl |\n- Emmental râpé | 30 g |\n- Chèvre | 110 g |\n- Noix | 60 g |\n- Sel fin | 3 tours |\n- Poivre | 3 tours |\n\n## Cake\n\n1. Mélanger oeufs, farine, sel et poivre puis l'huile et le lait.\n\n2. Ajouter l'emmental puis le chèvre coupé en cubes et les noix concassées.\n\n**Cuire 35 min.**\n"}}]);